import '../css/items_exper.css'
import React from 'react';

const Item_exp = (props) => {
    const { id, url, title, describ } = props;
    return (
        <div className="Experience-box" id={id}>
            <div className='video'>
            <iframe width="420" height="3280" src="https://www.youtube.com/embed/CY5WLrSYPzo?si=E8d2kXYVL5Dd99ob" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" referrerpolicy="strict-origin-when-cross-origin" allowfullscreen></iframe>
            </div>
            <div className="description">
                <h2 className='title'>{title}</h2>
                <p className='descrip'>{describ}</p>
            </div>
        </div>
    );
}

export default Item_exp;
